import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navigation from './Navigation';
import HeroSection from './HeroSection';
import AboutSection from './AboutSection';
import ActivitiesContent from './ActivitiesContent';
import TeamSection from './TeamSection';
import ConuAISection from './ConuAISection';
import FooterContent from './FooterContent';
import AppContainer from './AppContainer.jsx';
import MobileNavigation from './MobileNavigation.jsx';

function App() {
  return (
    <Router>
      <AppContainer />
      <Navigation />
      <MobileNavigation />
      <Routes>
        {/* Main route - current site */}
        <Route path="/" element={
          <>
            <HeroSection />
            <AboutSection />
            <ActivitiesContent />
            <TeamSection />
            <ConuAISection />
          </>
        } />

        {/* Empty routes for future expansion */}
        <Route path="/about" element={<div></div>} />
        <Route path="/activities" element={<div></div>} />
        <Route path="/team" element={<div></div>} />
        <Route path="/conuai" element={<div></div>} />
      </Routes>
      <FooterContent />
      <next-route-announcer className="absolute"></next-route-announcer>
    </Router>
  );
}

export default App;
